vec3 filmicToneMap(const in vec3 c) {
                                           vec3 x = max(vec3(0.0), c - vec3(0.4));    
                                           return (x * (6.2 * x + vec3(0.5))) / (x * (6.2 * x + vec3(1.7)) + vec3(0.06));
                                       }

